INSERT INTO `modelinglanguageelement` VALUES ('046b189c-75b1-4f09-9d29-df91b8e2ca93','Rules (not in BPMN)','The rules guide the process execution, interaction, courses and conditions.',NULL,NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('10a1ab6b-3184-4d24-b55a-bcde30861ead','Data Object (Resource)','It respresents data objects as files, forms and etc.','bpmn:dataObjectReference',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('14ed9e30-b664-4583-93d9-3473106335fd','Localization (not in BPMN)','Places and physics locals in the organization',NULL,NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('1e6c7e18-7373-4c2e-8da7-cd7d22d3e943','User Task','It is a task performed by an user','bpmn:userTask','26345c60-b7be-4098-ab36-d5b075aad479','b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('26345c60-b7be-4098-ab36-d5b075aad479','Task','They are simple activities performed by once.','bpmn:task',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('31eadc22-0fd8-45ba-b15a-fa822aaeda38','Intermediate Event (Throw)','It this some happening that can change the process flow (throw)','bpmn:intermediateThrowEvent',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('45a8a364-d28d-4eab-8b65-4bf28f5bcf68','Data Store (Resource)','It represents system data, data bases, and stores.','bpmn:dataStoreReference',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('4a67bdd8-7195-4269-8ba7-f0dff4db26cc','Script Task','It is a task performed by a script','bpmn:scriptTask','26345c60-b7be-4098-ab36-d5b075aad479','b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('5b21d565-5a99-4951-b3a3-5c86399d8697','Business Rule Task','It task describe a process rule','bpmn:businessRuleTask','26345c60-b7be-4098-ab36-d5b075aad479','b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('65e75f2d-86ec-47ad-862f-80e6f568d60f','Exclusive Gateway','It is conditions creating unique path in the process follow some condition.','bpmn:exclusiveGateway',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('66d7087e-764e-4e80-829b-c1522f96ae3c','Start Event','Initial happening of the process','bpmn:startEvent',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('731bfdaf-59d2-48bb-9a41-179a42f36176','Sub Process','It is a composed activitie, that have into sequences of others tasks.','bpmn:subProcess',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('7780c25a-0962-4049-947d-042ab671fdcf','Annotations','Annotations and comments about the process.','bpmn:textAnnotation',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('8a41aa9e-c368-4101-988c-e06b7dc669b3','Sequence Flow','It represents a sequential temporal order of tasks.','bpmn:sequenceFlow',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('8fb31f6b-3955-447e-a6a6-657d26f0e78e','Pool or Participant','Sequence of activities to reach business goals, or some participant of the process.','bpmn:process',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('992c92d5-1e08-4a00-ab4d-59856c83647a','Boundary Event','It is some event triggered inside of activities that can change the process flow or create parallel flows when its occour.','bpmn:boundaryEvent',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',0),('9ebe6f66-8f94-42b5-ab97-8b8b71201395','Parallel Gateway','It is conditions creating parallel path in the process','bpmn:parallelGateway',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('9fe13031-48cb-404b-be9e-efbad426f26d','Receive Task','It is a task to receive something','bpmn:receiveTask','26345c60-b7be-4098-ab36-d5b075aad479','b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('a6e2da4c-8b05-49c8-8406-467f4a47906b','Instances or Courses (not in BPMN)','This is some path (course) performed in the process.',NULL,NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('aca11f49-5c32-47cc-93b2-8c815fbd5808','Intermediate Event (Catch)','It this some happening that can change the process flow (catch)','bpmn:intermediateCatchEvent',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('af3af5ed-67f6-4ed9-b86b-e1c7861f091b','Pool or Participant (Black Box)','Hide process model or some process participant.','bpmn:participant',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('b1d8112b-48bb-4460-a043-59c182e65139','Goals (not in BPMN)','Goal to reach with the process.',NULL,NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('b6f2efde-7e32-4614-b565-76d65cd9b781','Data Association Flow (Input)','It represents the connection between resources and flow elements.','bpmn:dataInputAssociation',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('cce12713-1de1-4927-877c-030394691ea1','Inlcusive Gateway','It perform one or many paths in the process follwoing rules.','bpmn:inclusiveGateway',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('cf03ce15-6a5a-469c-a143-d400166fe0ac','Service Task','It is a task performed by a service','bpmn:serviceTask','26345c60-b7be-4098-ab36-d5b075aad479','b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('dc029987-fd24-489c-923a-31680c1569ec','Data Association Flow (Output)','It represents the connection between resources and flow elements.','bpmn:dataOutputAssociation',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('dcac9d99-0ad7-4a64-b1c2-97782c4ea189','End Event','Final happening of the process','bpmn:endEvent',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('e3a5f4dc-5d8a-4f1e-8ad3-f5323ecb19fc','Manual Task','It is a task perfoemed through manual way','bpmn:manualTask','26345c60-b7be-4098-ab36-d5b075aad479','b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('e733e91c-99a0-4eee-ab84-65f79b56b5e7','Message Flow','It indicates the communication among different pols.','bpmn:messageFlow',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('e9524f1e-ea42-4a61-9cdc-84605e673607','Lane','Person or department responsable for execute activites.','bpmn:lane',NULL,'b8b1b942-ac76-4752-abad-594aefdc463f',NULL),('faadf43a-5bab-4ac8-898a-c5287d163bc2','Send Task','It is a task to send sometinh','bpmn:sendTask','26345c60-b7be-4098-ab36-d5b075aad479','b8b1b942-ac76-4752-abad-594aefdc463f',NULL);
